import $ from "jquery";

$(document).ready(function() {
  loadAll();
  $(".Home").click(function() {
    loadAll();
  });
});

export const loadAll = () => {
  var ammount = 0;
  $.ajax({
    type: "GET",
    url: "http://localhost:4242/api/1.0/length",
    dataType: "json",
    success: function(response) {
      ammount = response.length;
      for (var i = 0; i < ammount; i++) {
        $.ajax({
          type: "POST",
          url: "http://localhost:4242/api/1.0/get",
          dataType: "json",
          async: false,
          data: {
            itteration: i
          },
          success: function(response) {
            console.log(response);
            var grid2Ammount = 0;
            if (response.level == 1) {
              $(".grid-container").append(
                $('<div class="row">').append(
                  $('<a class="location-title">').text(response.title),
                  $('<div class="col">').append(
                    $("<a>").append(
                      $(
                        '<img class="thumbnail" src="data:image/png;base64,' +
                          response.thumbnail +
                          '">'
                      )
                    )
                  )
                )
              );
            } else {
              if (grid2Ammount == 0 || grid2Ammount == 1) {
                grid2Ammount++;
                $(".grid-container").append(
                    $('<div class="row">').append(

                      $('<a class="location-title">').text(response.title),
                      $('<div class="imaging">').append(
                        $("<a>").append(
                          $(
                            '<img class="thumbnail" src="data:image/png;base64,' +
                              response.thumbnail +
                              '">'
                          )
                        )
                      )
                    )
                  );
              }
              else{
                grid2Ammount = 0;
                $(".grid-container").append(
                    $('<article class="location-listing-2">').append(
                      $('<a class="location-title">').text(response.title),
                      $('<div class="location-image">').append(
                        $("<a>").append(
                          $(
                            '<img class="thumbnail" src="data:image/png;base64,' +
                              response.thumbnail +
                              '">'
                          )
                        )
                      )
                    )
                  );
              }
            }
          },
          error: function() {}
        });
      }
    },
    error: function() {}
  });
};
